import React from 'react';
import '../../App.css';
import { Button } from './Button';
export default function Products() {
  return (
    <div className='hero-container'>
      <h1>Yousef Dardir</h1>
      <p>Everything About Me</p>
      <div className='hero-btns'>
        <Button
          className='btns'
          buttonStyle='btn--outline'
          buttonSize='btn--large'
        >
          Contact Me
        </Button>
      </div>
    </div>
  );
}
